import React, { useState } from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faBars, faGlobe } from '@fortawesome/free-solid-svg-icons';
import './navbar.css';

function Navbar() {
  // State for mobile view to track navbar toggling
  const [navState, setNavState] = useState(0); // 0: hidden, 1: navbar1, 2: navbar2

  // Function to toggle between hidden, navbar1, and navbar2 in mobile view
  const handleNavbarToggle = () => {
    setNavState((prevState) => (prevState + 1) % 3); // Cycles through 0 -> 1 -> 2 -> 0
  };

  return (
    <nav className="navbar">
      {/* Navbar header with logo and hamburger menu for mobile */}
      <div className="navbar-header">
        <div className="navbar-hamburger" onClick={handleNavbarToggle}>
          <FontAwesomeIcon icon={faBars} />
        </div>
        <div className="navbar-logo">
          <h1>Business Solution</h1>
        </div>
      </div>

      {/* Desktop Navbar (navbar1 and navbar2 visible simultaneously on large screens) */}
      <div className="navbar-desktop">
        {/* Navbar1 (first row) */}
        <div className="navbar1">
          <ul className="navbar-menu">
            <li>Driver</li>
            <li>Rider</li>
            <li>Business</li>
            <li>Log in</li>
            <li>Sign up</li>
            <li><FontAwesomeIcon icon={faGlobe} /> En</li>
          </ul>
        </div>
        {/* Navbar2 (second row) */}
        <div className="navbar2">
          <ul className="navbar-menu2">
            <li>Products</li>
            <li>Solutions</li>
            <li>Customers</li>
            <li>Resources</li>
            <li>Contact us</li>
            <li>Get started</li>
          </ul>
        </div>
      </div>

      {/* Mobile Navbar (shown only on small screens based on state) */}
      {navState === 1 && (
        <div className="navbar1-mobile">
          <ul className="navbar-menu">
            <li>Driver</li>
            <li>Rider</li>
            <li>Business</li>
            <li>Log in</li>
            <li>Sign up</li>
          </ul>
        </div>
      )}
      {navState === 2 && (
        <div className="navbar2-mobile">
          <ul className="navbar-menu2">
            <li>Products</li>
            <li>Solutions</li>
            <li>Customers</li>
            <li>Resources</li>
            <li>Contact us</li>
            <li>Get started</li>
          </ul>
        </div>
      )}
    </nav>
  );
}

export default Navbar;
